webpackJsonp([7938221577335],{896:function(e,t){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/nsclippy/index.md absPath of file >>> MarkdownRemark",html:'<p>What’s the one thing iOS lacks? No it’s not real multitasking, inter-app communication, or reliable data syncing. It’s never had an animated assistant based on office stationary.</p>\n<p>Well you’re in luck:</p>\n<h3>How to get Clippy in your app</h3>\n<p>Download or clone the <a href="https://github.com/weiran/NSClippy">NSClippy repository on GitHub</a>. Include all the files in /NSClippy (excluding the Example directory) in your project, or use <a href="http://cocoapods.org">CocoaPods</a>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">pod &#39;NSClippy&#39;</code></pre>\n      </div>\n<p>Adding Clippy to your view:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">NSClippy *clippy = [[NSClippy alloc] initWithAgent:@&quot;clippy&quot;];\n[self.view addSubview:clippy];\n[clippy show];</code></pre>\n      </div>\n<p>And to show an animation:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">[clippy showAnimation:@&quot;GetArtsy&quot;];</code></pre>\n      </div>\n<p>For now you’ll have to move him and make his speech bubble yourself. If you do give him the power of speech, please be kind and submit a pull request.</p>\n<hr>\n<h3>Credits</h3>\n<p>NSClippy is an Objective-C port of smore’s excellent <a href="https://www.smore.com/clippy-js">ClippyJS</a>. I’ve used all the assets from their project, including the sprites, animations, and sound.</p>\n<hr>\n<h3>About the maker</h3>\n<p>Any questions? Ask me on Twitter: <a href="https://twitter.com/weiran">@weiran</a></p>\n<p>I also make an <a href="https://github.com/weiran/hackers">open source</a> Hacker News reader app for iPhone called <a href="http://weiranzhang.com/hackers">Hackers</a>.</p>',frontmatter:{title:"NSClippy for iOS",date:"April 04, 2013",passthroughUrl:null}}},pathContext:{slug:"/blog/nsclippy/",previous:{fields:{slug:"/blog/2013/4/wireds-most-influential-mobile-phones/"},frontmatter:{title:"Wired's most influential mobile phones",passthroughUrl:"http://www.wired.com/gadgetlab/2013/04/influential-cellphones/?viewall=true"}},next:{fields:{slug:"/blog/2013/4/apple-changes-vpn-on-demand-behaviour-due-to-lawsuit/"},frontmatter:{title:"Apple changes VPN on Demand behaviour due to lawsuit",passthroughUrl:"http://support.apple.com/kb/TS4550"}}}}}});
